                    float: 'left',
                    margin: '0px 0px 0px 8%',
                    // border: '5px solid #555',
                    height: '40%',
                    width: '40%'
                }}>
        <h3>{data.answer}</h3>
        </div>
        </div>

        </>
     );
}
 
